import React from 'react';

import {
    XAxis, YAxis, CartesianGrid, Tooltip,
    AreaChart, Area,
  } from 'recharts';

  const data = [
    {
      name: 'Page A', uv: 4000,
    },
    {
      name: 'Page B', uv: 3000,
    },
    {
      name: 'Page C', uv: 2000,
    },
    {
      name: 'Page D', uv: 2780,
    },
    {
      name: 'Page E', uv: 1890,
    },
    {
      name: 'Page F', uv: 2390,
    },
    {
      name: 'Page G', uv: 3490,
    },
    {
        name: 'Page G', uv: 3490,
    },
    {
        name: 'Page G', uv: 3490,
    },
    {
        name: 'Page G', uv: 3490,
    },

  ];

class AreaChartItem extends React.Component{
    render(){
        return(
            <AreaChart className = "AreaChart"
                width={1500}
                height={700}
                data={data}
                syncId="anyId"
                margin={{
                  top: 10, right: 30, left: 0, bottom: 0,
                }}
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Area type="monotone" dataKey="uv" stroke="#82ca9d" fill="#82ca9d" />
              </AreaChart>
        )
    }
}

export default AreaChartItem
